import { Route, Routes } from "react-router-dom";
import Home from "./routes/home/home.component";

export const Shop = () => {
  return ( <h1>I am Shop Component</h1>)
}

const App = () => {
  return (
    <Routes>
     <Route path="/home" element={<Home />}>
        <Route path="shop" element = {<Shop />} />
      </Route> 
    </Routes>
  );
}

export default App;
